webpackJsonp([0xf04a3ac8361e],{436:function(p,n){p.exports={data:{markdownRemark:{html:'<h1>pdb</h1>\n<h2>Установка:</h2>\n<pre><code>pip install pdb\n</code></pre>\n<h2>Использование:</h2>\n<p>В тексте программы</p>\n<pre><code class="language-python">import pdb\n\n...\n\npdb.set_trace()\n</code></pre>\n<p>В консоли</p>\n<pre><code>python example.py\n</code></pre>\n<h2>Команды:</h2>\n<p>n (next) - следующая команда</p>\n<p>b (break) [lineno] - установить брейкпойнт на указанном номере строки</p>\n<p>l (list)- показать контекст текущего места (l 5, 15 - показать с 5 по 15 строчку)</p>\n<p>u (up), d (down) - перемещение по стеку вверх и вниз </p>\n<p>a (args) - вывод всех аргументов текущей функции</p>\n<p>p (print) - вывести содержимое переменной или произвольного выражения. можно указывать через запятую, напр. p a, b, c. Впрочем, можно их выводить и без указания p.</p>\n<p>!&#x3C;команда> - выполнить команду в интерпретаторе</p>\n<p>c (continue) - продолжить выполнение</p>\n<p>s (step) - аналогично n, но с заходом внутрь вызываемой функции</p>',frontmatter:{path:"/blog/pdb",title:"pdb"}}},pathContext:{}}}});
